DELIMITER $$
CREATE TRIGGER `trg_assign_trans_saleperson` BEFORE INSERT ON `transactions`
 FOR EACH ROW BEGIN
        IF NEW.saleperson_id = 0 THEN
	SET NEW.saleperson_id = (SELECT ssn
                      FROM salespersons sp
                      WHERE sp.ssn NOT IN (SELECT ssn FROM manage_regions mr) AND 
                      sp.ssn NOT IN (SELECT ssn FROM manage_stores ms) AND
                      sp.store_id = NEW.store_id
                      ORDER BY RAND()
                      LIMIT 1);

END IF;
    END
$$
DELIMITER ;

